#include <iostream>
#include <vector>
#include <queue>
#include <utility> 
using namespace std;

class Solution {
public:
	typedef pair<int, int> Point;

	void solve(vector<vector<char>>& board) {
		int row = board.size();

		if (row == 0)
		{
			return;
		}

		int col = board[0].size();

		//if (row <= 2 || col <= 2)
		//{
		//	return;
		//}

		b_.resize(row);
		for (auto& x : b_)
		{
			x.resize(col, -1);
		}

		for (size_t i = 0; i < row; i++)
		{
			checkReachable(i, 0, board);
		}

		for (size_t i = 0; i < row; i++)
		{
			checkReachable(i, col - 1, board);
		}

		for (size_t i = 0; i < col; i++)
		{
			checkReachable(0, i, board);
		}

		for (size_t i = 0; i < col; i++)
		{
			checkReachable(row - 1, i, board);
		}

		change(board);
	}

private:
	void checkReachable(int i, int j, vector<vector<char>>& board)
	{
		if (i < 0 || j < 0 || i >= board.size() || j >= board[0].size())
		{
			return;
		}

		if (board[i][j] != 'O')
		{
			return;
		}
		//
		//if (board[i][j] == 'O')
		//{
		//	b_[i][j] = 1;

		//	checkReachable(i - 1, j, board);
		//	checkReachable(i + 1, j, board);
		//	checkReachable(i , j + 1, board);
		//	checkReachable(i , j - 1, board);
		//}
		//else
		//{
		//	b_[i][j] = 0; //visited
		//}


		queue<Point> que;
		que.push(Point(i, j));

		while (!que.empty())
		{
			auto q = que.front();
			que.pop();

			if (b_[q.first][q.second] == 1)
			{
				continue;
			}

			if (q.first -1 >= 0 && board[q.first-1][q.second] == 'O')
			{
				que.push(Point(q.first - 1, q.second));
			}

			if (q.first + 1 < board.size() && board[q.first + 1][q.second] == 'O')
			{
				que.push(Point(q.first + 1, q.second));
			}

			if (q.second - 1 >= 0 && board[q.first][q.second - 1] == 'O')
			{
				que.push(Point(q.first, q.second - 1));

			}

			if (q.second + 1 < board[0].size() && board[q.first][q.second + 1] == 'O')
			{
				que.push(Point(q.first, q.second + 1));
			}

			b_[q.first][q.second] = 1;
		}



	}

	void change(vector<vector<char>>& board)
	{
		for (int i = 0; i < board.size(); i++)
		{
			for (int j = 0; j < board[0].size(); j++)
			{
				if (b_[i][j] == -1)
				{
					board[i][j] = 'X';
				}
			}
		}
	}

	vector<vector<int>> b_;
};


